import { useState } from 'react';

const users = [
    { name: 'Michelle', age: 30 },
    { name: 'Ilana', age: 4 },
    { name: 'Freddy', age: 2 },
    { name: 'Daphne', age: 2 }
]

const UserSearch: React.FC = () => {
    const [name, setName] = useState('');
    return <div>
        User Search
        <input value={name} onChange={e => setName(e.target.value)} />
    </div>
}

export default UserSearch;
